import React, { useState } from 'react';
import {
  Form,
  FormGroup,
  Label,
  Input,
  FormText,
  Button,
} from 'reactstrap';

function Formulario () {
  return (
    <Form>
      <FormGroup tag="fieldset">

        <FormGroup>
          <Input name="respuestas" id='resp1' type="radio" />{' '}
          <Label for='resp1'>Rojiza, blanca</Label>
        </FormGroup>


      </FormGroup>
    </Form>
  );
}

export default Formulario;
